weight_lookup = SumOfPairsWeightLookup(
    TableWeightLookup.create_from_2d_matrix_file('BLOSUM62.txt', -5)
)
col_count = len(alignment[0])
col_scores = []
for c in range(col_count):
    elems = tuple([a[c] if a[c] != '-' else None for a in alignment])
